function bottomNav(){const t=document.querySelectorAll(".js-bottom-nav__item");t&&t.forEach(function(o){o.addEventListener("click",function(e){e.preventDefault(),t.forEach(function(t){t.classList.contains("js-bottom-nav__item-active")&&t.classList.remove("js-bottom-nav__item-active")}),o.classList.add("js-bottom-nav__item-active")},!1)})}export{bottomNav};